import styled from "styled-components";
import { Container } from "react-bootstrap";

export const Bigbox = styled(Container)`
  .container-fluid {
    padding-left: none;
    padding-right: none;
    margin: none;
  }
  padding: 30px 30px;
  border: 1px solid #c4c4c4;
`;
